import Link from "next/link";
export default function Header() {
  return (
    <header className="w-full h-20 flex justify-end">
      <nav className="flex justify-center items-end px-3 font-hairline">
        <Link href="/">
          <a className=" mx-2 p-4 ">About</a>
        </Link>
        <Link href="/portfolio">
          {" "}
          <a className=" mx-2 p-4 ">Portfolio</a>
        </Link>
        {/* <Link> <a className=" mx-2 p-4 ">Blog</a></Link> */}
      </nav>
    </header>
  );
}
